  [],\n\t\"revision_timestamp\": \"2015-09-26T22:01:14.828808\",\n\t\"name\": \"ex1204-northeastern-canyons-and-continental-margins-exploration-on-noaa-ship-okeanos-explorer-b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During the Okeanos Explorer (EX) mission
  EX1204, the vessel will sail from Norfolk, VA, along the continental shelf break
  of the U.S. East Coast from Virginia to Rhode Island, to the shipu00c3u00a2u00c2u0080u00c2u0099s
  home port of Davisville, RI.  The goal of the mission is to explore northeastern
  canyons and continental margins using the shipu00c3u00a2u00c2u0080u00c2u0099s Kongsberg
  EM302 multibeam sonar, Simrad EK60, and Knudsen sub-bottom profiler.  CTD casts
  are probable around different locations around the axis of the canyons with niskin
  bottle firings for water sampling, depending upon staff availability.  XBT casts
  will be fired every 4 hours for system calibration checks.  Multibeam data collected
  in a sloped but featureless area in the vicinity of McMaster canyon will be used
  in comparison with data in this same area recorded by the NOAA Ship Hassler and
  the NOAA Ship Bigelow.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
